DROP TABLE IF EXISTS `v_compra_detallado`;
CREATE ALGORITHM=UNDEFINED SQL SECURITY DEFINER VIEW `v_compra_detallado` AS SELECT 
C.idcompra,
C.numerodocumento,
C.numerotimbrado,
C.fecha,
C.idproveedor,
P.razonsocial,
CD.idarticulo,
CD.numeroitem,
(CD.costo + CD.iva) AS costo,
CD.cantidad
